import { HttpClient, I } from '@angular/common/http';


@Injectable({
      providedIn: 'root'
    })


export class FoodService {


      genericFood = ('./db/generic_food.csv');

      constructor(private http: HttpClient) {}

      getInfo() {
            console.log(this.genericFood)
            return this.http.get(this.genericFood, {responseType: 'text'})
      }

}
